var fileJSON=[{"path":"c:/gesturenet/pyopencl/gesturenet.cl", "name":"gesturenet.cl", "has_active_debug_locs":true, "absName":"c:/gesturenet/pyopencl/gesturenet.cl", "content":"//maxPool2d \012//kernel_size=3 stride=2\012//output one feature map per kernel\012__kernel void maxpool2d(\012	const int input_size,\012	const int output_size,\012	__global float *input_im,\012    __global float *restrict output_im)\012{\012	int channels = get_global_id(0);//get output channel index\012	\012	input_im += channels * input_size * input_size;\012	output_im += channels * output_size * output_size;\012\012	//loop over output feature map\012	for(int i = 0; i < output_size; i++)//row\012	{\012		for(int j = 0; j < output_size; j++)//col\012		{\012			//find the max value in 3x3 reigon \012			//to be one element in the output feature map\012			float tmp = 0.0;\012\012			#pragma unroll 1\012			for(int k = 0; k < 3; k++)//row\012			{\012				#pragma unroll\012				for(int l = 0; l < 3; l++)//col\012				{\012					float value = input_im[(i * 2 + k) * input_size  + j * 2 + l ];\012					if(value > tmp)\012						tmp = value;\012				}\012			}\012			//store the result to output feature map\012			*output_im = tmp; \012			output_im++;\012		}\012	}\012}\012\012//3x3 convolution layer\012//output one feature map per kernel\012__kernel void conv2d3x3(\012	const int input_channels, const int input_size,\012	const int pad, const int stride,\012	const int start_channel, //start_channel is for 1x1 feature map in fire layer\012	const int output_size,\012	__global float* input_im,\012	__global const float* filter_weight,\012	__global const float* filter_bias,\012	__global float *restrict output_im\012	)\012{\012	int filter_index = get_global_id(0); //get output channel index\012\012	filter_weight += filter_index * input_channels * 9;\012	float bias = filter_bias[filter_index];\012	output_im += (start_channel + filter_index) * output_size * output_size;\012	\012	//loop over output feature map\012	for(int i = 0; i < output_size; i++)\012	{\012		for(int j = 0; j < output_size; j++)\012		{\012			//compute one element in the output feature map\012			float tmp = bias;\012			\012			//compute dot product of 2 input_channels x 3 x 3 matrix\012			for(int k = 0; k < input_channels; k++)\012			{\012				for(int l = 0; l < 3; l++)\012				{\012					int h = i * stride + l - pad;\012\012					#pragma unroll\012					for(int m = 0; m < 3; m++)\012					{\012						int w = j * stride + m - pad;\012						if((h >= 0) && (h < input_size) && (w >= 0) && (w < input_size))\012						{\012							tmp += input_im[k * input_size * input_size + (i * stride + l - pad) * input_size + j * stride + m - pad] \\\012                               * filter_weight[9 * k + 3 * l + m];\012						}\012					}\012				}\012			}\012\012			//add relu activation after conv\012			*output_im = (tmp > 0.0) ? tmp : 0.0;\012			output_im++;\012		}\012	}\012}\012\012//1x1 convolution layer\012//output one feature map per kernel\012__kernel void conv2d1x1(\012	const int input_channels, const int input_size_x, const int input_size_y,\012	__global float *input_im,\012	__global const float* filter_weight,\012	__global const float* filter_bias,\012	__global float *restrict output_im)\012{\012	int filter_index = get_global_id(0); // 0 - (output_channels - 1)\012\012	filter_weight += filter_index * input_channels;\012\012	float bias = filter_bias[filter_index];\012	\012	output_im += filter_index * input_size_x * input_size_y;//start_channel is for 1x1 feature map in fire layer\012\012	//loop over output feature map\012	//out\012	for(int i = 0; i < input_size_x; i++)\012	{\012		for(int j = 0; j < input_size_y; j++)\012		{\012			float tmp = bias;\012\012			#pragma unroll 3\012			for(int k = 0; k < input_channels; k++)\012			{\012				tmp += input_im[k * input_size_x * input_size_y + i * input_size_x + j] * filter_weight[k];\012			}\012			//add relu after conv\012			*output_im = (tmp > 0.0) ? tmp : 0.0;\012			output_im++;\012		}\012	}\012}\012\012//last layer use a 13 x 13 avgPool layer as classifier\012// Modified to make it NxM avgPool layer as classifier\012//one class score per kernel\012__kernel void avgpool2d(\012	const int sizex,\012	const int sizey,\012	__global float* input_im,\012	__global float *restrict output_im)\012{\012	int class_index = get_global_id(0);//get class score index\012	input_im += sizex * sizey * class_index;\012	float tmp = 0.0f;\012\012	for(int i = 0; i < sizex*sizey; i++)\012	{\012		tmp += input_im[i];\012	}\012\012	output_im[class_index] = tmp / (sizex*sizey);\012}\012\012// Fully Connected layer\012__kernel void fc(\012	const int sizex,\012	const int sizey,\012	__global float* input_im,\012	__global float* filter_weight,\012	__global float* filter_bias,\012	__global float *restrict output_im)\012{\012	int filter_index = get_global_id(0);\012	filter_weight += filter_index * sizex * sizey;\012	float tmp = filter_bias[filter_index];\012	for(int i=0; i<sizex; i++){\012		for(int j=0; j<sizey; j++){\012			tmp += filter_weight[i*sizex+j] * input_im[i*sizex+j];\012		}\012	}\012	// Relu\012	output_im[filter_index] = (tmp > 0.0) ? tmp : 0.0;\012}"}];